import React, { Component } from 'react'
import  {storeProduct} from "./../../assets/Data";

export default class Product extends Component {
    state={
        product:storeProduct
    }
    render() {
        console.log(this.state.product);
        return (
            <React.Fragment>
                 <h1 className="container">Yo product</h1>
                <div className="container">
                    <div className="card">
                        <img src="{this.state.product[0].img}" alt="Google pixel" className="card-img-top" onClick={console.log("i am clicked")}/>
                    </div>
                </div>

            </React.Fragment>
        )
    }
}
